import React, { useState } from "react";

const Users = (props) => {
  const { usersDB } = props;
  return (
    <div className="users-list">
      {usersDB.map((user) => {
        <UserItem key={user.id} username={user.username} age={user.name} />;
      })}
    </div>
  );
};

export default Users;
